import './App.css';
import TodoForm from './components/TodoForm';
import TodoItem from './components/TodoItem';
import { useSelector } from 'react-redux';

function App() {
  const data = useSelector((state) => state.todo.value);
  console.log(data);
  return (
    <div className="App">
      <h1>Niraj</h1>
      <TodoForm />
      {
        data.map((res)=>{
          console.log(res);
          <TodoItem task={res}/>
        })
      }
      <TodoItem />
    </div>
  );
}

export default App;
